import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { QueryClient, QueryClientProvider } from 'react-query';
import { AuthProvider } from './contexts/AuthContext';
import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import RoomsPage from './pages/RoomsPage';

// Create a query client
const queryClient = new QueryClient({
  defaultOptions: {
    queries: {
      retry: 1,
      staleTime: 5 * 60 * 1000, // 5 minutes
    },
  },
});

// Simple placeholder components for missing pages
const RoomsPage404 = () => (
  <div className="min-h-screen flex items-center justify-center">
    <div className="text-center">
      <h2 className="text-2xl font-bold text-gray-900 mb-4">Rooms Page</h2>
      <p className="text-gray-600">Room listings coming soon...</p>
      <Link to="/" className="text-blue-600 hover:text-blue-700">‚Üê Back to Home</Link>
    </div>
  </div>
);

const NotFoundPage = () => (
  <div className="min-h-screen flex items-center justify-center">
    <div className="text-center">
      <h2 className="text-6xl font-bold text-gray-900 mb-4">404</h2>
      <h3 className="text-2xl font-semibold text-gray-700 mb-4">Page Not Found</h3>
      <p className="text-gray-600 mb-8">The page you're looking for doesn't exist.</p>
      <Link
        to="/"
        className="bg-blue-600 text-white px-6 py-3 rounded-md hover:bg-blue-700 transition duration-200"
      >
        Go Home
      </Link>
    </div>
  </div>
);

// Main navbar component
const Navbar = () => (
  <nav className="bg-white shadow-lg">
    <div className="max-w-7xl mx-auto px-4">
      <div className="flex justify-between items-center h-16">
        <div className="flex items-center space-x-2">
          <span className="text-blue-600 text-2xl">üè®</span>
          <Link to="/" className="text-xl font-bold text-gray-900">HotelBook</Link>
        </div>

        <div className="flex items-center space-x-6">
          <Link to="/" className="text-gray-700 hover:text-blue-600">Home</Link>
          <Link to="/rooms" className="text-gray-700 hover:text-blue-600">Rooms</Link>
          <Link to="/login" className="text-gray-700 hover:text-blue-600">Login</Link>
          <Link to="/register" className="bg-blue-600 text-white px-4 py-2 rounded-md hover:bg-blue-700">Register</Link>
        </div>
      </div>
    </div>
  </nav>
);

// Footer component
const Footer = () => (
  <footer className="bg-gray-900 text-white py-8">
    <div className="max-w-7xl mx-auto px-4 text-center">
      <div className="flex items-center justify-center space-x-2 mb-4">
        <span className="text-blue-400 text-2xl">üè®</span>
        <span className="text-xl font-bold">HotelBook</span>
      </div>
      <p className="text-gray-400">¬© 2024 HotelBook. All rights reserved.</p>
      <div className="mt-4 space-x-6">
        <span className="text-gray-400 text-sm">üöÄ System Status</span>
      </div>
      <div className="mt-2 space-x-4 text-sm">
        <span className="text-green-400">‚úÖ Frontend: Running</span>
        <span className="text-green-400">‚úÖ Backend: http://localhost:8001</span>
        <span className="text-green-400">‚úÖ Database: MySQL</span>
      </div>
      <div className="mt-4">
        <a 
          href="http://localhost:8001/docs" 
          target="_blank" 
          rel="noopener noreferrer"
          className="text-blue-400 hover:text-blue-300"
        >
          üîß View API Documentation
        </a>
      </div>
    </div>
  </footer>
);

function App() {
  return (
    <QueryClientProvider client={queryClient}>
      <Router>
        <AuthProvider>
          <div className="min-h-screen bg-gray-50">
            <Navbar />

            <main>
              <Routes>
                <Route path="/" element={<HomePage />} />
                <Route path="/login" element={<LoginPage />} />
                <Route path="/register" element={<RegisterPage />} />
                <Route path="/rooms" element={<RoomsPage />} />
                <Route path="*" element={<NotFoundPage />} />
              </Routes>
            </main>

            <Footer />
          </div>
        </AuthProvider>
      </Router>
    </QueryClientProvider>
  );
}

export default App;
